-- 创建数据库代码
-- 创建news数据库
CREATE TABLE `news` (
  `id` varchar(255) NOT NULL COMMENT '新闻主键',
  `pubDate` datetime DEFAULT NULL COMMENT '发布时间',
  `pubDateStr` varchar(0) DEFAULT NULL COMMENT '时间描述',
  `title` varchar(255) DEFAULT NULL COMMENT '新闻标题',
  `summary` varchar(600) DEFAULT NULL COMMENT '内容简述',
  `infoSource` varchar(255) DEFAULT NULL COMMENT '新闻来源',
  `sourceUrl` varchar(255) DEFAULT NULL COMMENT '新闻链接',
  `provinceName` varchar(255) DEFAULT NULL COMMENT '省份',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `modifyTime` datetime DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- 今日数据
CREATE TABLE `nowdata` (
                           `id` varchar(20) NOT NULL COMMENT 'id',
                           `confirmedCount` varchar(255) DEFAULT NULL COMMENT '确诊病例',
                           `confirmedCount_yesterday` varchar(255) DEFAULT NULL COMMENT '相比昨日确诊数',
                           `suspectedCount` varchar(255) DEFAULT NULL COMMENT '疑似病例',
                           `suspectedCount_yesterday` varchar(255) DEFAULT NULL COMMENT '相比昨日',
                           `curedCount` varchar(255) DEFAULT NULL COMMENT '治愈人数',
                           `curedCount_yesterday` varchar(255) DEFAULT NULL,
                           `deadCount` varchar(255) DEFAULT NULL,
                           `deadCount_yesterday` varchar(255) DEFAULT NULL,
                           `nowconfirmed` varchar(255) DEFAULT NULL COMMENT '现存人数',
                           `nowconfirmed_yesterday` varchar(255) DEFAULT NULL,
                           `heavy` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '现存疑似',
                           `heavy_yesterday` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                           PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

