-- 各地数据

CREATE TABLE `dxyarea` (
                           `provinceName` varchar(255) DEFAULT NULL,
                           `provinceEnglishName` varchar(255) DEFAULT NULL,
                           `province_zipCode` varchar(255) DEFAULT NULL,
                           `cityName` varchar(255) DEFAULT NULL,
                           `cityEnglishName` varchar(255) DEFAULT NULL,
                           `city_zipCode` varchar(255) DEFAULT NULL,
                           `province_confirmedCount` int(11) DEFAULT NULL,
                           `province_suspectedCount` int(11) DEFAULT NULL,
                           `province_curedCount` int(11) DEFAULT NULL,
                           `province_deadCount` int(11) DEFAULT NULL,
                           `city_confirmedCount` int(11) DEFAULT NULL,
                           `city_suspectedCount` int(11) DEFAULT NULL,
                           `city_curedCount` int(11) DEFAULT NULL,
                           `city_deadCount` int(11) DEFAULT NULL,
                           `updateTime` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

